import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import '../CSS/Index.css'
import Login from './Login';
import Register from './Register';
import '../CSS/Login.css'
import logo from '../img/logo.png';
import Button from 'react-bootstrap/Button';
import React, { useState } from 'react';


function NavbarBucks () {

  const [showLogin, setShowLogin] = useState(false);
  const [showRegister, setShowRegister] = useState(false);
  const [showStatus, setStatus] = useState(false);

  return (
    <>
      <Navbar>
        <Container>
          <Navbar.Brand href="#home">
            <img
              alt="logo"
              src={logo}
              width="70"
              height="70"
              className="d-inline-block align-top"
            />
          </Navbar.Brand>

          <div clasName="button" >


            <Button variant="outline-danger" margin="50px" onClick={() => setShowLogin(!showLogin)}>
            Login
           </Button>
           <Login
            show={showLogin}
            statusCheck={() => setShowLogin(!showLogin) & setStatus(!showStatus)}
            onRegis={() => setShowLogin(!showLogin) & setShowRegister(!showRegister)}
            onHide={() => setShowLogin(!showLogin)}
           />
            {" "}

            <Button variant="danger" onClick={() => setShowRegister(!showRegister)}>
            Register
            </Button>
            <Register
              show={showRegister}
              statusCheck={() => setShowLogin(!showLogin) & setStatus(!showStatus)}
              onLogin={() => setShowRegister(!showRegister) & setShowLogin(!showLogin)}
              onHide={() => setShowRegister(!showRegister)}
            />

          </div>
        </Container>
      </Navbar>


    </>
  );
}

export default NavbarBucks ;
